import styles from "../styles/Contactus.module.css";

export default function SectionBody({ children, hover }) {
  return (
    <div className={styles["section-body"]}>
      {children}
      <style jsx>{`
        .section-body:hover {
          background-color: ${hover ? "#2eb6ad" : ""};
          border-bottom: 4px solid #29a39b;
          color: #ffffff;
        }
      `}</style>
    </div>
  );
}
